import React, { useState } from 'react';
import { useDispatch } from 'react-redux';
import SimpleInput from '../../items/simpleInput/simpleInput';

import './movieForm.css';
// import { Link } from 'react-router-dom';

const MovieForm = (props) => {
  const dispatch = useDispatch();

  const handleSubmit = (event) => {
    event.preventDefault();
    const formData = Object.fromEntries(new FormData(event.target).entries());
    // setUserAction(formData)(dispatch);
    console.log(formData);
  };

  return (
    <form onSubmit={handleSubmit} className="movieForm">
      <div className="boxInput">
        <label>
          <input type={'text'} name={'name'} placeholder={'name'} />
        </label>
        <label>
          <input type={'text'} name={'type'} placeholder={'type'} />
        </label>
        <label>
          <input type={'text'} name={'image'} placeholder={'image'} />
        </label>
        <label>
          <input type={'text'} name={'description'} placeholder={'description'} />
        </label>
        <label>
          <input type={'number'} name={'year'} min={1900} max={new Date().getFullYear()} placeholder={'year'} />
        </label>
        <label>
          <SimpleInput type={'text'} name={'ageRating'} placeholder={'ageRating'} />
        </label>
        <label>
          <SimpleInput type={'text'} name={'genre'} placeholder={'genre'} />
        </label>
      </div>
      <button className="sendButton" type="submit">
        Create and save
      </button>
    </form>
  );
};

export default MovieForm;
